import "./App.css";
import CreateUser from "./CreateUser";
const App = () => {
  const [users,setUsers] = [{}]
  usersGames = []
  const handleOnAddUser = (valueFirstName,valueLastName,valueUserName) => 
  {
    const user = {}
    user[valueUserName] ={"firstName": valueFirstName , "lastName": valueLastName}
    setUsers(...users,user)
  }
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1 className="App-title">ReactND - Coding Practice</h1>
      </header>
      <CreateUser  OnAddUser={handleOnAddUser}/>
    </div>
  );
};

export default App;
